var CookieDuration = 31;	// let cookies live for one month

// Unicode Slide Show

// Variables for current character state
var charCount = 0;	// Count of characters processed so far
var thePlane = 0;	// Current plane
var theBlock = 0;	// Current block
var theChar = 0;	// Current character (decimal codepoint value)
var lastChar = 0;	// Last character to display
var codepoint = "00"		// Hexadecimal codepoint of the current character
var tableIndex = 0;	// Index of character name in the current character name table
var nameTable = null;	// Pointer to the character name table for the current block
var startBlock = 0;	// Block to start enumerating from
var endBlock = NumBlocks;	// Block after final block to enumerate to (NumBlocks for all characters)
