// Deal with parameters passed to the page
// As parameters are mutually exclusive we only process the first parameter
// 
// http://www.babelstone.co.uk/Unicode/unicode_fr.html
// http://www.babelstone.co.uk/Unicode/unicode_fr.html?caractere=1234
// http://www.babelstone.co.uk/Unicode/unicode_fr.html?caractere=hasard
// http://www.babelstone.co.uk/Unicode/unicode_fr.html?nom=nom de caractère
// http://www.babelstone.co.uk/Unicode/unicode_fr.html?chercher=chaîne de caractères
// 
function ProcessPageParams()
{
	var handled = false;

	if ( location.search )
	{
		var params = location.search.substring(1).split( "&" );
		var a = params[0].split( "=" );
		var param = a[0].toLowerCase();
		var value = unescape( a[1] );

		if ( param == "caractere" )
		{
			if ( value.toLowerCase() == "hasard" )
			{
				OnRandomCharacter();
			}
			else
			{
				document.getElementById( "gototext" ).value = value;
				OnGotoButton();
			}
			handled = true;
		}
		else if ( param == "chercher" )
		{
			document.getElementById( "searchtext" ).value = value;
			OnSearchButton();
			handled = true;
		}
		else if ( param == "nom" )
		{
			document.getElementById( "searchcheck" ).checked = true;
			document.getElementById( "searchtext" ).value = value;
			OnSearchButton();
			handled = true;
		}
	}

	// Set to "X" initially if not otherwise specified
	if ( handled == false )
	{
		SetCharacter( 0, "0058" );
	}
}

// http://www.babelstone.co.uk/Unicode/whatisit_fr.html
// http://www.babelstone.co.uk/Unicode/whatisit_fr.html?caractere=caractère unicode
// http://www.babelstone.co.uk/Unicode/whatisit_fr.html?chaine=chaîne de caractères
// http://www.babelstone.co.uk/Unicode/whatisit_fr.html?utf8=chaîne de caractères UTF-8
// http://www.babelstone.co.uk/Unicode/whatisit_fr.html?unicode=chaîne de caractères UTF-16
// 
function InitialiseConversion()
{
	// Get preferences if available
	var defaultFontSizeIndex = 2;
	var defaultFontColourIndex = 3;
	var defaultBackColourIndex = 0;
	var defaultHighColourIndex = 6;
	var defaultFontMappingIndex = 0;
	var defaultFontName = "";

	if ( location.search )
	{
		var params = location.search.substring(1).split( "&" );
		var a = params[0].split( "=" );
		var param = a[0].toLowerCase();
		var value = unescape( a[1] );

		// Some browsers (IE and Edge) represent all characters as UTF-16
		// But some browsers (Chrome and Firefox) use UTF-8 escape sequences for everything that is not Basic Latin
		if ( param == "caractere" )
		{
			// Deals with a single Unicode character
			if ( value.length > 1 )
			{
				if ( ! IsHighSurrogate( value.charCodeAt(0) ) )
				{
					var result = ConvertFromUTF8( value );
					value = result[1];
				}
			}
			document.getElementById( "edittextin" ).value = value;
			OnConvertCharactersToNames();
		}
		else if ( param == "utf8" )
		{
			// For Chrome and Firefox
			var newValue = "";
			var length =0;
			// This will abort on first invalid UTF-8 character
			do 
			{
				var output = ConvertFromUTF8( value );
				length = output[0];
				if ( length > 0 )
				{
					newValue += output[1];
					value = value.substr( output[0] );
				}
			} while ( length != 0 );
			document.getElementById( "edittextin" ).value = newValue;
			OnConvertCharactersToNames();
		}
		else if ( param == "unicode" )
		{
			// For IE and Edge
			document.getElementById( "edittextin" ).value = value;
			OnConvertCharactersToNames();
		}
		else if ( param == "chaine" )
		{
			// Try parsing as UTF-8
			var tempValue = value;
			var newValue = "";
			var length =0;
			// This will abort on first invalid UTF-8 character
			do 
			{
				var output = ConvertFromUTF8( tempValue );
				length = output[0];
				if ( length > 0 )
				{
					newValue += output[1];
					tempValue = tempValue.substr( output[0] );
				}
			} while ( length != 0 );

			if ( tempValue.length == 0 )
			{
				// Successfully parsed whole string as UTF-8
				document.getElementById( "edittextin" ).value = newValue;
				OnConvertCharactersToNames();
			}
			else
			{
				// UTF-8 failed so treat as UTF-16
				document.getElementById( "edittextin" ).value = value;
				OnConvertCharactersToNames();
			}
		}
	}
}

function FinaliseConversion()
{
	// Store current state (no state currently stored)
}

