// http://www.babelstone.co.uk/Unicode/babelmap_fr.html?bloc=nom de bloc
// http://www.babelstone.co.uk/Unicode/babelmap_fr.html?caractere=1234
// http://www.babelstone.co.uk/Unicode/babelmap_fr.html?nom=nom de caractère
// http://www.babelstone.co.uk/Unicode/babelmap_fr.html?chercher=chaîne de caractères
// 
function ProcessBabelMapParams()
{
	if ( location.search )
	{
		var params = location.search.substring(1).split( "&" );
		var a = params[0].split( "=" );
		var param = a[0].toLowerCase();
		var value = unescape( a[1] );

		if ( param == "bloc" )
		{
			value = value.toLowerCase();
			for ( b = 0; b < NumBlocks; b++ )
			{
				if ( BlockName[b].toLowerCase() == value )
				{
					WriteChart( b );
					break;
				}
			}
		}
		else if ( param == "caractere" )
		{
			document.getElementById( "gototext" ).value = value;
			OnGotoCharacter();
		}
		else if ( param == "chercher" )
		{
			document.getElementById( "searchtext" ).value = value;
			OnSearchCharacter();
		}
		else if ( param == "nom" )
		{
			document.getElementById( "searchcheck" ).checked = true;
			document.getElementById( "searchtext" ).value = value;
			OnSearchCharacter();
		}
	}
}

